import Concept from "./Concept.js";

export default function Concepts(props) {
  return (
    <div>
      <Concept data={props.data[0]}></Concept>
      <Concept data={props.data[1]}></Concept>
      <Concept data={props.data[2]}></Concept>
    </div>
  );
}
